'use strict'

/**
 * Tips:
 * 1. Iterate string s one by one, save the character and its count (for the same repeating character) into array repeatingCharCount.
 * 2.1 Iterate repeatingCharCount, for each element (of length K), add up K*(k+1)/2 to answer. (e.g., 'aaa' has 6 substrings altogher)
 * 2.2 Iterate repeatingCharCount, starts from the second element ends the second-last element, this is to compare the current one with its 
 *     previous/next element to see if those three matches 'aaaxaaaaaa' pattern, if matches adds up Math.min(prev.length, next.length), because 
 *     it means substring like axa, aaxaa, aaaxaaa, etc.
 * @param {*} n 
 * @param {*} s 
 */
function substrCount(n, s) {
    const S_LENGTH = s.length;
    if (S_LENGTH <= 1)
        return S_LENGTH;

    let prevChar = s[0], prevCount = 1, repeatingCharCount = [];
    for (let i = 1; i < S_LENGTH; i++) {
        let currentChar = s[i];
        if (currentChar === prevChar)
            prevCount++;
        else {
            repeatingCharCount.push({ char: prevChar, count: prevCount });
            prevChar = currentChar;
            prevCount = 1;
        }
    }
    repeatingCharCount.push({ char: prevChar, count: prevCount });

    // 2.1
    let count = 0;
    for (let i = 0; i < repeatingCharCount.length; i++) {
        let charCount = repeatingCharCount[i].count;
        count += charCount * (charCount + 1) / 2;
    }

    // 2.2
    if (S_LENGTH > 2) {
        for (let i = 1; i < repeatingCharCount.length - 1; i++) {
            let prev = repeatingCharCount[i - 1], current = repeatingCharCount[i], next = repeatingCharCount[i + 1];
            if (prev.char === next.char && current.count === 1)
                count += Math.min(prev.count, next.count);
        }
    }

    return count;
}

main();
function main() {
    let input = `5
    asasd`;             // expects 7

    input = `7
    abcbaba`;           // expects 10

    input = `4
    aaaa`;              // expects 10

    input = `93534
    `;
  
    let lines = input.split('\n').map(l => l.trim()).filter(l => l !== ''), index = 0;
    const n = parseInt(lines[index++], 10), s = lines[index++];

    const result = substrCount(n, s);
    console.log(result);
}
